DROP TABLE IF EXISTS "comments";
DROP SEQUENCE IF EXISTS comments_id_seq;
CREATE SEQUENCE comments_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1;


DROP TABLE IF EXISTS "actors";
DROP SEQUENCE IF EXISTS actors_id_seq;
CREATE SEQUENCE actors_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1;

CREATE TABLE "public"."actors" (
    "id" integer DEFAULT nextval('actors_id_seq') NOT NULL,
    "name" character varying(255) NOT NULL,
    "avatar" text NOT NULL,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    "deleted_at" timestamp(0),
    CONSTRAINT "actors_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

DROP TABLE IF EXISTS "posts";
DROP SEQUENCE IF EXISTS posts_id_seq;
CREATE SEQUENCE posts_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1;

CREATE TABLE "public"."posts" (
    "id" integer DEFAULT nextval('posts_id_seq') NOT NULL,
    "olimpico_id" integer NOT NULL,
    "text" text NOT NULL,
    "image" text NOT NULL,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    "deleted_at" timestamp(0),
    CONSTRAINT "posts_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "posts_olimpico_id_foreign" FOREIGN KEY (olimpico_id) REFERENCES actors(id) ON UPDATE RESTRICT ON DELETE RESTRICT NOT DEFERRABLE
) WITH (oids = false);

CREATE TABLE "public"."comments" (
    "id" integer DEFAULT nextval('comments_id_seq') NOT NULL,
    "post_id" integer NOT NULL,
    "olimpico_id" integer NOT NULL,
    "text" text NOT NULL,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    "deleted_at" timestamp(0),
    CONSTRAINT "comments_pkey" PRIMARY KEY ("id"),
    CONSTRAINT "comments_olimpico_id_foreign" FOREIGN KEY (olimpico_id) REFERENCES actors(id) ON UPDATE RESTRICT ON DELETE RESTRICT NOT DEFERRABLE,
    CONSTRAINT "comments_post_id_foreign" FOREIGN KEY (post_id) REFERENCES posts(id) ON UPDATE RESTRICT ON DELETE RESTRICT NOT DEFERRABLE
) WITH (oids = false);


DROP TABLE IF EXISTS "contrataciones";
DROP SEQUENCE IF EXISTS contrataciones_id_seq;
CREATE SEQUENCE contrataciones_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1;

CREATE TABLE "public"."contrataciones" (
    "id" integer DEFAULT nextval('contrataciones_id_seq') NOT NULL,
    "cod_firma" character varying(255),
    "gestion" character varying(255),
    "detalle" character varying(255),
    "representante_legal" character varying(255),
    "informe_scep" text,
    "nota" text,
    "usuario_abm_id" integer,
    "empresa_id" integer,
    "owner_id" integer,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    "deleted_at" timestamp(0),
    CONSTRAINT "contrataciones_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

