DROP TABLE IF EXISTS "notifications";
CREATE TABLE "public"."notifications" (
    "id" uuid NOT NULL,
    "type" character varying(255) NOT NULL,
    "notifiable_id" integer NOT NULL,
    "notifiable_type" character varying(255) NOT NULL,
    "data" text NOT NULL,
    "read_at" timestamp(0),
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    CONSTRAINT "notifications_pkey" PRIMARY KEY ("id")
) WITH (oids = false);

CREATE INDEX "notifications_notifiable_id_notifiable_type_index" ON "public"."notifications" USING btree ("notifiable_id", "notifiable_type");


DROP TABLE IF EXISTS "processes";
DROP SEQUENCE IF EXISTS processes_id_seq;
CREATE SEQUENCE processes_id_seq INCREMENT 1 MINVALUE 1 MAXVALUE 9223372036854775807 START 1 CACHE 1;

CREATE TABLE "public"."processes" (
    "id" integer DEFAULT nextval('processes_id_seq') NOT NULL,
    "process_id" character varying(255) NOT NULL,
    "data" text NOT NULL,
    "tokens" text NOT NULL,
    "status" character varying(255) NOT NULL,
    "bpmn" character varying(255) NOT NULL,
    "created_at" timestamp(0),
    "updated_at" timestamp(0),
    CONSTRAINT "processes_pkey" PRIMARY KEY ("id")
) WITH (oids = false);


